"""# __Model Architection Projection__

![image.png](data:image/png;base64,)
"""

def build_parallel_coordinates(df: pd.DataFrame) -> go.Figure:
    layer_ranges = df.groupby('layer name')['score'].agg(['min', 'max']).to_dict('index')
    label_order = df.drop_duplicates('label', keep='first')[['label', 'layer name']].values.tolist()
    models = df['model name'].unique().tolist()

    dimensions = []
    for label, layer in label_order:
        values = (
            df[df['label'] == label]
            .set_index('model name')['score']
            .reindex(models)
            .tolist()
        )
        dimensions.append({
            'label': label,
            'values': values,
            'range': list(layer_ranges[layer].values())
        })

    fig = go.Figure(go.Parcoords(
        line=dict(color=list(range(len(models))), showscale=False),
        dimensions=dimensions
    ))
    fig.update_layout(title='Parallel Coordinates Plot by Model', plot_bgcolor='white')
    return fig
